padding: 3rem;
border-radius: 20%;
padding-right: 2rem;
padding-bottom: 2rem;
width: 50%;
margin: auto;
padding-left: 2rem;

 .snooze {


    width: auto;
    text-align: center;
    font-size: 7rem;
    color: #343f56;
    border-radius: 20%;
    display: inline;
 }
`;
